import Logo from '../../assets/img/logolenosycarbon.png';
import Botonatras from '../../assets/img/atras.png';
import Botoncerrarsesion from '../../assets/img/cerrarsesion.png';
import './Carritoheader.css';

function Carritoheader() {
  return (
  	<header>
	  	<div className="logo">
	  		<img src={logito} />
	  	</div>

	  	<div className="botones">
	    	<button className="btn-azul"><img src={Botonatras} width="15px"/>  Registro</button>
	    	<button className="btn-morado"><img src={ingresar} width="15px"/> Ingresar</button>
	  	</div>
	 </header>
  );
}

export default Carritoheader;
